import { Text, View, TextInput, TouchableOpacity } from "react-native";
import { useForm } from "react-hook-form";
import { Products } from "../../models/products";
import { URL } from "../../environments/env";
import { styles } from "../../style/style";
import { useState } from "react";
import React from "react";
import axios from "axios";
import { Users } from "../../models/users";

// localstorage
const USER_INFO = "@userInfo";
const AUTH_INFO = "@authInfo";
const PRODUCT_INFO = "@productInfo";
const SALE_INFO = "@saleInfo";

export default function ProductsForm({ navigation, route }) {
  //#region atributos
  let products = [];
  let product = new Products();
  let user = new Users();

  const [formData, setFormData] = useState(new Products());
  const [errorMess, setErrorMess] = useState("");

  const { handleSubmit, reset } = useForm({
    defaultValues: new Products(),
  });
  //#endregion

  //#region functions
  const getStorageData = async () => {
    try {
      user = await AsyncStorage.getItem(USER_INFO);
      console.log(user);
      auth = await AsyncStorage.getItem(AUTH_INFO);
      console.log(auth);
      product = await AsyncStorage.getItem(PRODUCT_INFO);
      console.log(product);
      sale = await AsyncStorage.getItem(SALE_INFO);
      console.log(sale);
    } catch (e) {
      console.log(e);
      AsyncStorage.clear();
    }
  };

  //#region services
  //get one by email for login
  async function getAllProducts() {
    await axios
      .get(`${URL}/products/getAll`)
      .then((response) => {
        products = response.data;
      })
      .catch((e) => {
        setErrorMess(e);
        console.log(e);
        setTimeout(() => {
          setErrorMess("");
        }, 1500);
      });
  }

  const createProduct = async () => {
    getAllProducts();
    if (formData.name !== "" && formData.price !== "") {
      if (products) {
        const findProduct = products.find((x) => x.name === formData.name);
        if (findProduct) {
          setErrorMess("El producto ya esta registrado");
          setTimeout(() => {
            setErrorMess("");
          }, 2000);
        } else {
          await axios
            .post(`${URL}/products/create`, formData)
            .then((response) => {
              if (response.data) {
                setErrorMess("Producto registrado con exito.");
                setTimeout(() => {
                  setErrorMess("");
                }, 2000);
                reset();
              }
            })
            .catch((e) => {
              console.log(e);
              setErrorMess(e);
              setTimeout(() => {
                setErrorMess("");
              }, 2000);
            });
        }
      }
    } else {
      setErrorMess("Todos los campos son obligatorios.");
      setTimeout(() => {
        setErrorMess("");
      }, 2000);
    }
    reset();
  };
  //#endregion

  //#region events
  const onChange = (e, type) => {
    setFormData({ ...formData, [type]: e });
  };
  //#endregion

  //#endregion
  if (user) {
    return (
      <View style={styles.container}>
        <Text style={styles.title}>Products</Text>
        <Text style={styles.subtitle}>Create a product</Text>
        <TextInput
          style={styles.textInput}
          placeholder="Name"
          onChangeText={(e) => onChange(e, "name")}
          defaultValue={product.name ? product.name : formData.name}
        />
        <TextInput
          style={styles.textInput}
          placeholder="DateOfPreparation"
          onChangeText={(e) => onChange(e, "dateOfPreparation")}
          editable={false}
          defaultValue={
            product.dateOfPreparation
              ? product.dateOfPreparation
              : formData.dateOfPreparation
          }
        />
        <TextInput
          style={styles.textInput}
          placeholder="Price"
          // keyboardType="numeric"
          onChangeText={(e) => onChange(e, "price")}
          defaultValue={product.price ? product.price : formData.price}
        />
        <TouchableOpacity
          style={styles.button}
          onPress={handleSubmit(createProduct)}
        >
          <Text>Create</Text>
        </TouchableOpacity>
        <TouchableOpacity
          onPress={() => {
            navigation.navigate("ProductsList");
          }}
        >
          <Text style={styles.text}>Ver productos</Text>
        </TouchableOpacity>
        <Text style={{ fontWeight: "bold", marginTop: 10, color: "black" }}>
          {errorMess}
        </Text>
      </View>
    );
  } else {
    navigation.navigate("Signin");
  }
}
